import React from "react";

function SinglePostPage({ posts, logedinUser, selectedPost }) {
  console.log(selectedPost);

  return (
    <div className="single-post">
      <img src={selectedPost.image} alt="" />
      <div className="info">
        <h1>{selectedPost.title}</h1>
        <h4>{selectedPost.location}</h4>
        <img src={logedinUser.picture} alt="" />
        <h1>{logedinUser.email}</h1>
      </div>
    </div>
  );
}

export default SinglePostPage;
